import logo from './3DVR.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header  className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <p className= "Productions">
          Productions
        </p>
        <p className="Catch-phrase">
        Build The Future
        </p>
       <p className='coming-soon'>Biography coming soon...</p> 
      </header>
    </div>
  );
}

export default App;
